import { Button, Navbar, Nav, NavItem, Form, FormControl, NavDropdown, MenuItem } from 'react-bootstrap'

const JumpLabel = (props) => (
    <Nav.Link href={props.link}><img
    alt=""
    src={props.image}
    width="40"
    height="40"
    className="d-inline-block align-top"
    target="_blank"
  /></Nav.Link>




);
export default JumpLabel;
